import Navigationbar from "./Navigationbar";
function Home() {
    const [isLoading, setIsLoading] = useState(true);
   if (isLoading) {
    return <LoadingScreen onLoadingComplete={() => setIsLoading(false)} />;
  }
  return (
    <div className="Home">
      <Navigationbar />
    </div>
  );
}
export default Home;
